import react from 'react';

import './Header.css';
import Button from '@material-ui/core/Button';

class Header extends react.component {

    render() {
        return (
            <div>
                <Button variant="contained" color="default">
                    Login
                </Button>
            </div>
        )
    }
}

export default Header;
